import React from 'react';
import './meals.css';

function Meals() {
    return (
        <div id="meals">
            <ul id="meals-list">
                <li>Completo</li>
                <li>Hamburguesa</li>
            </ul>
            <form>
                <input type="hidden" />
                <input type="submit" />
            </form>
        </div>
    );
}

export default Meals;
